import React, { Component } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import IconButton from '@material-ui/core/IconButton';
import AccountCircle from '@material-ui/icons/AccountCircle';


class Header extends Component {

  render() {
    return (<header>
      <div className="header">
        <div className="header__logo">Harvest</div>
        <div className="header__button" >
          <a className="header__button--select">応援する</a>
          <a href="/support" className="header__button--noselect">支援中</a>
          <a href="/Setting" className="header__button--noselect">支援してもらう</a>
        </div>
        <div className="header__login">
        <a href="/login" className="header__login--icon"><AccountCircle style={{fontSize: '40px'}}/></a>
        </div>
      </div>
    </header>);
  }
}
export default Header;
